     * <li> SECTIONS bool optional default 'Y'
     * <li> EDIT_FILE_BEFORE string(255) optional
     * <li> EDIT_FILE_AFTER string(255) optional
     * <li> IN_RSS bool optional default 'N'
     * <li> SORT int optional default 500
     * </ul>
     */
