         * 		<ul>
         * 		<li>SORT - by SORT field.
         * 		<li>ID - by ID field.
         * 		<li>NAME - by language depended NAME field (must be used with LANGUAGE_ID in the filter).
         * 		</ul>
         * 	values are case insensitive:
         * 		<ul>
         * 		<li>DESC - in descending order.
         * 		<li>ASC - in ascending order.
