         * 		<li>=ID - when contains array[]string uses <i>in</i> operator.
         * 		<li>NAME - uses <i>like</i> operator and is <i>case insensitive</i>.
         * 		<li>LANGUAGE_ID - uses <i>strict equal</i> operator and is <i>case sensitive</i>.
         * 		</ul>
